import React from 'react';


const Todos = ({todos}) => {
    return(
        <div>
            {
                todos.length ? (
                    todos.map(todo=>{
                    <div>
                        {todo.content}
                    </div>
                    })
                ) : (
                    <p>Nothing to do , Have a good day!</p>
                )
            }
        </div>
    );
}

export default Todos;
